import './App.css';
import Login from './Component/Login'
import HomePage from './Component/HomePage'
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";



function App() {
  return (
    <Router>

    <div className="App">
      <Switch>
      <Route
              exact
              path="/"
              component={(props) => (
                <Login
                  {...props}
                />
              )}
            />
      <Route
        exact
        path="/"
        component={(props) => (
          <Login
            {...props}
          />
        )}
      />
      </Switch>
    </div>
    </Router>
  );
}

export default App;
